    "**ASK Phase**\n",
    "\n",
    "The step requires us to provide context around the business needs and understand the true issues: \n",
    "\n",
    "The Google Analytics Certification provides details behind the businesss such as: \n",
    "* You are a junior analyst working to help the department leader answer questions about memberships for customers\n",
    "* Specifically you are tasked with build a customer profile around the membership classes\n",
    "* You final task is to give insight on how to encourage one class of members to become another class of members (more profitable for company)\n",
    "* There is an additional component of the 'final ask' - you are asked to provide insight on social media and digital media's influence on increasing sales for the class of customers you seek to influence."
