   "source": [
    "**SHARE**\n",
    "\n",
    "Sharing your findings is the next and logical step. Our findings are: \n",
    "\n",
    "1. The total trip duration for casual riders is 1.9 times higher than that of the annual members. \n",
    "2. The weekend contains the higher trip durations and peaks around August (if cyclical data holds true).\n",
    "3. Annual members are the largest portion of the dataset (19%)\n",
    "4. More data exists for beginning of data set than the end\n",
    "5. In all months, annual members ride more than the casusal members in all reporting months\n",
    "6. Tempature and weather appear to play big factor in usage rates\n",
    "7. We have more annual memebers during the morning, mainly between 5am and 11am. We have more casuals between 11pm and 4am.\n",
    "8. There's a big increase of usage in the midweek between 6am to 8am for annual members; takes a dip ,and another big increase is from 5pm to 6pm.\n"
   ]
